import React from "react";
import useSWR from "swr";

import "../styles/Dashboard.css";

export default function Dashboard({ api }) {
  const fetcher = (url) => api.get(url).then((r) => r.data);
  const { data, error } = useSWR("/portfolio/list", fetcher);

  if (error) return <p className="dashboard-error">Error loading portfolio</p>;
  if (!data) return <p className="dashboard-loading">Loading...</p>;

  return (
    <div className="dashboard-container">
      <h2 className="dashboard-title">Your Portfolio</h2>

      <div className="portfolio-grid">
        {data.map((p) => (
          <div key={p._id} className="portfolio-card">
            <h3>{p.title}</h3>
            <p>{p.description}</p>

            {p.url && (
              <a
                href={p.url}
                target="_blank"
                rel="noreferrer"
                className="visit-btn"
              >
                Visit
              </a>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}
